import React from 'react';




class Login extends React.Component{

    passwords = ["abc123"];
    emails = ["john@smu.edu"];

    authenticateUser = e => {
        if ("abc123" === this.state.email && "john@smu.edu" === this.state.password)  
        {
          this.setState({ authenticated: true });
          console.log("correct details");
        }
        else 
        {
          console.log('failure to log in');
        }
    }

    state = {
        email: "",
        password: ""
      };

    render(){
        return<>
            <h1>NOverdose</h1>
            <div className="form-group">
                <form>
                    <label>Email</label>
                    <input
                                            type="text"
                                            name="email"
                                            value={this.state.email}
                                            onChange={ e => this.setState({ email: e.target.value }) }
                                            placeholder="Enter Email"
                                        />
                </form>
            </div>
            <div className="form-group">
            <form>
                <label>Password</label>
                <input
                                        type="text"
                                        name="email"
                                        value={this.state.password}
                                        onChange={ e => this.setState({ password: e.target.value }) }
                                        placeholder="Enter Email"
                                    />
            </form>
            <button className = "btn-lg btn-dark btn-block" type="button" color="success" disabled={!this.state.email || !this.state.password} 
                            onClick={this.authenticateUser}>Log In</button>
            </div>
            </>;
    }

}

export default Login;
